import React from "react";
import {Container, Row, Col, Card, Image} from "react-bootstrap";
import Vsc from "./vsc.png";
import Html from "./html.png";
import Css from "./css.png";
import Es6 from "./es6.jpeg";
import Node from "./node.png";
import Express from "./express.jpg";
import Sql from "./sql.jpg";
import Sqlze from "./sequelize.svg";
import Hdbrs from "./handlebars.png";
import Mongo from "./mongodb.png";
import Mongoose from "./mongoose.png";
import ReactJs from "./react.png";
import Github from "./github.png";
import Postman from "./postman.png";
import Bootstrap from "./bootstrap.png";
import Heroku from "./heroku.svg";

// import axios from "axios";
import "./grid.css";

class Gri extends React.Component {
    // constructor(props){
    //   super(props)
    //   // this.state={
    //   //   username: ""
    //   // }
    // }
    render(){
      return (
        <div className = "gridWrap">
        <Container>
        <Row>
            <Col>        
              <Image src = {Vsc} width =  " 100px" height = "100px" > 
              </Image> 
            </Col>      
            <Col>        
              <Image src = {Html}fluid> 
              </Image> 
            </Col> 
            <Col>        
              <Image src = {Css} width =  " 100px" height = "100px" > 
              </Image> 
            </Col>      
            <Col>        
              <Image src = {Es6} width =  " 100px" max-height = "100px" > 
              </Image> 
            </Col>   
            </Row>
          <Row>
            <Col>        
              <Image src = {Node}fluid> 
              </Image> 
            </Col>      
            <Col>        
              <Image src = {Express}fluid> 
              </Image> 
            </Col> 
            <Col>        
              <Image src = {Sqlze}fluid> 
              </Image> 
            </Col>      
            <Col>        
              <Image src = {Hdbrs}fluid> 
              </Image> 
            </Col>   
            </Row>
            <Row>
            <Col>        
              <Image src = {Mongo}fluid> 
              </Image> 
            </Col>      
            <Col>        
              <Image src = {ReactJs}fluid> 
              </Image> 
            </Col>      
            <Col>        
              <Image src = {Postman}fluid> 
              </Image> 
            </Col> 
            <Col>        
              <Image src = {Bootstrap}fluid> 
              </Image> 
            </Col>      
            </Row>
        </Container>
        </div>
      )
    } 
}

  export default Gri;
